timelines.push(["spring", 0, "alternate", true, [purple6, purple5, purple4], "#purple2", 1200, "spring", 500]);
timelines.push(["spring", 0, "alternate", true, [purple0, purplem1, purplem2], "#purple3", 800, "spring", 300]);
timelines.push(["spring", 0, "alternate", true, [purplem4, purplem3], "#purple4", 1400, "spring", 600]);
timelines.push(["spring", 0, "alternate", true, [purplem1, purple0, purple1, purple2, purple3, purple4], "#purple5", 2000, "spring", 900]);
for(var i=0; i<timelines.length; i++) {
    console.log(timelines[i]);
    animationstemp = anime.timeline({
        
        easing: timelines[i][0],
        duration: timelines[i][4].length * (timelines[i][6] + timelines[i][8]), //timelines[i][1],
        direction: timelines[i][2],
        loop: timelines[i][3]
    });
    animations.push(animationstemp);
    for(var j=0; j<timelines[i][4].length-1; j++) {
        animations[i].add({
            targets: timelines[i][5],
            duration: timelines[i][6],
            easing: timelines[i][7],
            delay: timelines[i][8],
            //direction: "alternate",
            d: [
                {
                    value: timelines[i][4][j]
                },
                {
                    value: timelines[i][4][j+1]
                }
            ]
        })
    }
}

for(var i=0; i<animations.length; i++) {
    animations[i].play;
}


